import React from 'react'
import "./Navbar.css";
 const Navbar = () => {
  return (
    <div className='nav'>
      <img className='nav_logo'
      src="https://variety.com/wp-content/uploads/2020/05/netflix-logo.png"
      width={80} height={40} 
      alt="netflix"/> 
    </div>
  )
}
export default Navbar;
